import React from "react";
import PropTypes from "prop-types";
import 'bootstrap/dist/css/bootstrap-grid.css';


export default function CreateEventForm({ color }) {
    return (
    <>
    <div
            className={
            "relative flex flex-col min-w-0 break-words w-full mb-6 shadow-lg rounded " +
            (color === "light" ? "bg-white" : "bg-lightBlue-900 text-white")
            }
        >
            <div className="rounded-t mb-0 px-4 py-3 border-0">
                <div className="flex flex-wrap items-center">
                    <div className="relative w-full px-4 max-w-full flex-grow flex-1">
                    <h3
                        className={
                        "font-semibold text-lg " +
                        (color === "light" ? "text-blueGray-700" : "text-white")
                        }
                    >
                    Create Society
                    </h3>
                    </div>
                </div>
            </div>
            {/* here */}
            <div className="container gx-4">
                <div className="row">
                    <div className="col-3">one</div>
                    <div className="col-3">two</div>
                    <div className="col-3">three</div>
                    <div className="col-3">four</div>
                </div>
            </div>
    </div>
        
    </>
    );
}

CreateEventForm.defaultProps = {
    color: "light",
};

CreateEventForm.propTypes = {
    color: PropTypes.oneOf(["light", "dark"]),
};
